properties.PROJ_DESC:
Construction of another pumping main for the Choa Chu Kang pumping station to improve its operational reliability.
The scope of work involves the:
1.	construction of about 2.1km of 800mm diameter pumping mains;
2.	construction of about 20m of 1500mm diameter sewers;
3.	construction of 14 chambers; and
4.	construction of ancillary works.
